import React from "react";

const Skills = () => {
  return (
    <div className="h-screen bg-gradient-to-br from-green-500 to-blue-300">
      <div className="home grid grid-cols-2 gap-4 w-[80%] ml-52 pt-20 bg-slate-500">
        Skills
      </div>
    </div>
  );
};

export default Skills;
